import React from "react";
import Article from "./Article";

const ArticleContainer = ({ data }) => {
  return (
    <div className="ArticleContainer">
      {data.length > 0 &&
        articles.map((article, i) => <Article key={i} article={article} />)}
    </div>
  );
};

export default ArticleContainer;
